  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of this study is
  to examine chick diet at the California gull  colony in Alviso, California in an
  attempt to better understand how the gulls are  foraging in the south San Francisco
  Bay habitat. Specifically, fluctuations in chick diet with respect to time, tidal
  cycle, and chick age have been examined. California gulls are among the several
  species of Larus gulls having undergone an increase in population in the twentieth
  century (Hunt 1972). Since the 1930's both the number of California gulls breeding
  in the northwestern United States and the number of breeding colonies have increased
  (Conover 1983). The Alviso colony, discovered in 1980 represents a western and slightly
  southern extension of the California gulls' breeding range. As the first colony
  situated on a Pacific coast estuary, it also represents a departure from the species'
  typical nesting habitat of islands in freshwater or saline lakes in the interior
  of the western U.S. and Canada (Jones 1986). The Alviso colony has grown from around
  12 nests in 1980 to *** nests in 1987 (Jones 1986, Peg Woodin pers. comm.). Jones
  (1986) reports that reproductive success at  the Alviso colony in 1983 and 1984
  was comparable to that at other colonies and that chick weight at fledging may have
  been slightly higher. In the south San Francisco Bay the gulls have access to a
  variety of foraging habitats. Based on chick diet the gulls were foraging in fresh
  and salt water, on salt evaporation ponds, beaches, levees, meadows, agricultural
  fields, and at garbage dumps (Jones 1986). He attributes the success of the Alviso
  colony in part to an abundant food supply.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
